import React from 'react';
import Item from './Item';

const navItems = [
  { id: 2, name: 'About', href: '/' },
  { id: 3, name: 'Experience', href: '/' },
  { id: 4, name: 'Work', href: '/' },
  { id: 5, name: 'Contact', href: '/' },
];

const Menu = () => {
  return (
    <div>
      {navItems.map((link) => (
        <Item key={link.id} link={link} />
      ))}
    </div>
  );
};

export default Menu;
